{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/oxiaofango/quantum-job-simulation-task-1?scriptVersionId=146915943\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"f69d7baf","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.010921,"end_time":"2023-10-17T09:08:03.249631","exception":false,"start_time":"2023-10-17T09:08:03.23871","status":"completed"},"tags":[]},"source":["# Quantium Virtual Internship - Retail Strategy and Analytics - Task 1\n","\n","<img src=\"https://i0.wp.com/post.healthline.com/wp-content/uploads/2022/04/potato-chips-basket-1296-728-header.jpg?w=1155&amp;h=1528\" width=\"70%\" height=\"70%\" align=\"center\"/>\n"," \n","## 1. Define the Problem / Objective:\n","\n","####     Objective:\n","\n","The objective of this analysis is to provide actionable insights to the Category Manager for Chips in order to better understand the types of customer who purchase Chips and their purchasing behavior within the region. These insights will be used to inform the strategic plan for the chip category in the next half year.\n","\n","## 2. Data Collection\n","\n","The data is given in xls files.\n","\n","1.  QVI Transaction files This dataset contains transactions spanning from Jul 2018 to Jun 2019. It includes information such as transaction date, total sales, product quantity, product name and loyal customer ID.\n","\n","2.  QVI Purchase Behaviour This dataset provides details about loyal customers. it includes attributes like LIFESTAGE and PREMIUM CUSTOMER.\n","\n","LIFESTAGE - This attribute categorize customer based on family status and life stage. It indicates factor whether they have children in pre-school, primary, or secondary school.\n","\n","PREMIUM CUSTOMER - This segmentation distinguishes shoppers by their preferences for products based on price point and type. It helps identify if customers lean towards quality or brand, or if they opt for mode budget friendly options."]},{"cell_type":"code","execution_count":1,"id":"e46178df","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-10-17T09:08:03.272357Z","iopub.status.busy":"2023-10-17T09:08:03.269459Z","iopub.status.idle":"2023-10-17T09:08:04.500599Z","shell.execute_reply":"2023-10-17T09:08:04.498709Z"},"papermill":{"duration":1.244294,"end_time":"2023-10-17T09:08:04.503585","exception":false,"start_time":"2023-10-17T09:08:03.259291","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]}],"source":["##### Loading libraries\n","library(tidyverse)\n","library(readxl)\n","library(ggplo