\n","  labs(x = \"Life Stage\", y = \"Total Sales\", title = \"Total Sales over Life Stage and Premium Customer\", fill = \"Premium Customer\") +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1), panel.background = element_rect(linewidth = 0.5, color = \"black\"))+\n","  scale_y_continuous(labels = scales::comma) +\n","  scale_fill_manual(values = fill_category)"]},{"cell_type":"markdown","id":"1ceb0411","metadata":{"papermill":{"duration":0.01803,"end_time":"2023-10-17T09:08:29.022939","exception":false,"start_time":"2023-10-17T09:08:29.004909","status":"completed"},"tags":[]},"source":["**Conclusion:** Sales are mainly coming from Budget - Older Families, Mainstream - Young Singles/Couples, Mainstream - Retirees.\n","\n","##### Step 2: Let's see if the higher sales are due to there being more customers who buy chips."]},{"cell_type":"code","execution_count":20,"id":"8598e140","metadata":{"execution":{"iopub.execute_input":"2023-10-17T09:08:29.060076Z","iopub.status.busy":"2023-10-17T09:08:29.058461Z","iopub.status.idle":"2023-10-17T09:08:29.466755Z","shell.execute_reply":"2023-10-17T09:08:29.464886Z"},"papermill":{"duration":0.430529,"end_time":"2023-10-17T09:08:29.469901","exception":false,"start_time":"2023-10-17T09:08:29.039372","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'LIFESTAGE'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZVwUaxsG8Hu2F5YuEQEDRLFbUOzuzmOLXcdW7I5XLKxjdysWdrdid2ErItId\nO++HRVxCGHCXxeH6//yw+0zdszM7XE48y7AsSwAAAADw9xPougAAAAAA0AwEOwAAAACeQLAD\nAAAA4AkEOwAAAACeQLADAAAA4AkEOwAAAACeQLADAAAA4AkEOwAAAACeQLAjIgp+1YdhGIZh\npt0KSHeE52uqMQxT6t9bOVZSlP/5XnUrmCskViUmZjoymxjuvXJG+wZVbfOZy8USI1PLctUb\njvfcFhivzIFSeWmojQHDMM+jE3JsiZFfVzAMIzOqnvFodyaUZRim8cUvyS1Z2lUgY4uLmDAM\n4xMck8E4+aUiJiWBQKBvaFKiSj0Pr/2xOu3xPe3uoSs4KAHoik