\n","                  group_by(LIFESTAGE, PREMIUM_CUSTOMER) %>%\n","                  summarise(average_price = sum(TOT_SALES)/sum(PROD_QTY)) %>%\n","                  arrange(desc(average_price))\n","\n","ggplot(data = averagePrice, mapping = aes(x = LIFESTAGE, y = average_price, fill = PREMIUM_CUSTOMER)) + \n","         geom_bar(stat = \"identity\") +\n","         geom_text(mapping = aes(label = round(average_price,2)), position = position_stack(vjust = 0.5)) +\n","         labs(x = \"Life Stage\", y = \"Average Price\", fill = \"Premium Customer\", title = \"Average Price per Unit Sold\") +\n","         theme(axis.text.x = element_text(angle = 45, hjust = 1), panel.background = element_rect(linewidth = 0.5, color =\"black\")) +\n","  scale_fill_manual(values = fill_category)"]},{"cell_type":"markdown","id":"a5285d07","metadata":{"papermill":{"duration":0.020627,"end_time":"2023-10-17T09:08:30.489053","exception":false,"start_time":"2023-10-17T09:08:30.468426","status":"completed"},"tags":[]},"source":["**Conclusion:** Mainstream Midage Single/Couples and Mainstream Young single/Couples are more willing to pay more per packet of chips compare to their budget and premium counterparts. This may be due to premium shoppers being more likely to buy healthy snacks and when they buy chips, this is mainly for entertainment purposes rather than their own consumption. This is also supported by there being fewer Premium Midage and Young Single/Couples buying chips compared to their mainstream counterparts.\n","\n","##### Step 5: As the difference is average price per unit isn't large, we can check if this difference is statistically different."]},{"cell_type":"code","execution_count":23,"id":"4a2c5bd7","metadata":{"execution":{"iopub.execute_input":"2023-10-17T09:08:30.533218Z","iopub.status.busy":"2023-10-17T09:08:30.531595Z","iopub.status.idle":"2023-10-17T09:08:30.599086Z","shell.execute_reply":"2023-10-17T09:08:30.597239Z"},"papermill":{"duration":0.092212,"end_time":"2023-10-17T09:08:30.601376","exception":false,"start_time":"2023-10-17T09:08:30.509164","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tTwo Sample t-test\n","\n","data:  t_test1$PRICE and t_test2$PRICE\n","t = 37.832, df = 57365, p-value < 2.2e-16\n","alternative hypothesis: true difference in means is not equal to 0\n","95 percent confidence interval:\n"," 0.3160272 0.3505620\n","sample estimates:\n","mean of x mean of y \n"," 4.039786  3.706491 \n"]},"metadata":{},"output_type":"display_data"}],"source":["##### Perform an independent t-test between mainstream vs premium and budget midage and young singles and couples\n","\n","data_unit_price <- data %>%\n","  mutate(PRICE =TOT_SALES/PROD_QTY)\n","\n","t_test1 <- data_unit_price %>%\n","            filter(PREMIUM_CUSTOMER == \"Mainstream\" & LIFESTAGE %in% c(\"YOUNG SINGLES/COUPLES\", \"MIDAGE SINGLES/COUPLES\"))\n","\n","t_test2 <- data_unit_price %>%\n","            filter(!PREMIUM_CUSTOMER == \"Mainstream\" & LIFESTAGE %in% c(\"YOUNG SINGLES/COUPLES\", \"MIDAGE SINGLES/COUPLES\"))\n","\n","t.test(t_test1$PRICE,\n","       t_test2$PRICE,\n","       var.equal = TRUE,\n","       mu = 0,\n","       conf.level = 0.95)"]},{"cell_type":"markdown","id":"560ceb1c","metadata":{"papermill":{"duration":0.020738,"end_time":"2023-10-17T09:08:30.642472","exception":false,"start_time":"2023-10-17T09:08:30.621734","status":"completed"},"tags":[]},"source":["-   The t-statistic is very large (t = 37.832), indicating a significant difference between the means of the two groups.\n","\n","-   The p-value is extremely small (p \\< 2.2e-16), which is essentially zero. This indicates very strong evidence against the null hypothesis.\n","\n","-   The alternative hypothesis suggests that the true difference in means is not equal to zero. In other words, there is a significant difference between the two groups.\n","\n","-   The 95% confidence interval for the true difference in means is between approximately 0.316 and 0.351. This means we can be highly confident (95% confidence) that the true difference falls within this range.\n","\n","**Conclusion:** Based on this t-test result, we have strong evidence to reject null hypothesis. The t-test results in a p-value of 2.2e-16, i.e. the unit price for mainstream, young and mid-age singles and couples are significantly higher than that of budget or premium, young and midage singles and couples.\n","\n","##### Step 6: We have quite a few interesting insights that we can dive into. We might want to target customer segments that contribute the most to sales to retain them or further increase sales. Let's look at Mainstream - young single/couples. For instance, let's find out if they tend to buy particular brand of chips."]},{"cell_type":"code","execution_count":24,"id":"e74e82b7","metadata":{"execution":{"iopub.execute_input":"2023-10-17T09:08:30.68833Z","iopub.status.busy":"2023-10-17T09:08:30.686781Z","iopub.status.idle":"2023-10-17T09:08:30.793679Z","shell.execute_reply":"2023-10-17T09:08:30.790684Z"},"papermill":{"duration":0.133188,"end_time":"2023-10-17T09:08:30.796102","exception":false,"start_time":"2023-10-17T09:08:30.662914","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 20 × 4</caption>\n","<thead>\n","\t<tr><th scope=col>BRAND</th><th scope=col>occurences</th><th scope=col>predicted_trans</th><th scope=col>lift</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Tyrrells  </td><td> 619</td><td> 510.2636</td><td>1.2130984</td></tr>\n","\t<tr><td>Twisties  </td><td> 900</td><td> 748.8408</td><td>1.2018576</td></tr>\n","\t<tr><td>Doritos   </td><td>2379</td><td>1997.9649</td><td>1.1907116</td></tr>\n","\t<tr><td>Tostitos  </td><td> 890</td><td> 750.1873</td><td>1.1863703</td></tr>\n","\t<tr><td>Kettle    </td><td>3844<