","4  Tostitos    890        750.1873       1.1863703\n","5  Kettle     3844       3270.3764       1.1753999\n","6  Pringles   2315       1988.3014       1.1643104\n","7  Cobs        864        767.7717       1.1253345\n","8  Infuzions  1250       1124.8454       1.1112639\n","9  Grain       646        613.0768       1.0537017\n","10 Thins      1166       1114.8650       1.0458665\n","11 Cheezels    346        364.5985       0.9489891\n","12 Smiths     1921       2404.2273       0.7990093\n","13 Cheetos     166        231.8444       0.7159974\n","14 French       78        112.3182       0.6944556\n","15 Red         875       1292.7682       0.6768421\n","16 Natural     394        591.6112       0.6659780\n","17 CCs         222        360.4796       0.6158462\n","18 Sunbites    128        238.2603       0.5372275\n","19 Woolworths  479        937.5163       0.5109244\n","20 Burger       62        123.8827       0.5004735"]},"metadata":{},"output_type":"display_data"}],"source":["##### Work out of there are brands that these two customer segments prefer more than others. You could use a technique called affinity analysis or a-priori analysis (or any other method if you prefer)\n","\n","##### Deep dive into Mainstream, young singles/couples\n","\n","##### Step 1: Let's calculate the sum total\n","sum_total <- data %>%\n","  summarise(sum_total = n())\n","\n","##### Step 2: The LHS is brand, for whole dataset\n","LHS <- data %>%\n","    group_by(BRAND) %>%\n","    summarise(LHS_freq = n()/sum_total)\n","\n","##### Step 3: The Mainstream & Young Couples is RHS, for whole dataset\n","RHS <- data %>%\n","  filter(LIFESTAGE == \"YOUNG SINGLES/COUPLES\" & PREMIUM_CUSTOMER == \"Mainstream\") %>%\n","  summarise(RHS_freq = n()/sum_total)\n","\n","##### Step 4: Calculate the occurrences for Young Singles/Couples and Mainstream for each brand.\n","\n","occurences <- data %>%\n","              filter(LIFESTAGE == \"YOUNG SINGLES/COUPLES\" & PREMIUM_CUSTOMER == \"Mainstream\") %>%\n","              group_by(BRAND) %>%\n","              summarise(occurences = n())\n","\n","##### Step 6: Calculate Predicted Trans\n","predicted_trans <- LHS %>%\n","    group_by(BRAND) %>%\n","    summarise(predicted_trans = LHS_freq * RHS$RHS_freq*sum_total)\n","\n","##### Step 6: Merge occurences and predicted trans to calculate Lift for each brand\n","\n","lift_data <- merge(occurences,\n","                  predicted_trans,\n","                  by = \"BRAND\")\n","\n","lift_data$lift <- lift_data$occurences / lift_data$predicted_trans\n","\n","lift_data %>%\n","    mutate(predicted_trans = unlist(predicted_trans),\n","           lift = unlist(lift)) %>%\n","  arrange(desc(lift))"]},{"cell_type":"markdown","id":"076bb8a5","metadata":{"papermill":{"duration":0.022295,"end_time":"2023-10-17T09:08:30.847864","exception":false,"start_time":"2023-10-17T09:08:30.825569","status":"completed"},"tags":[]},"source":["The output <data.frame [22 × 1]> predicted_trans and lift columns in the lift_dataare still data frames, rather than vectors. This is because the format() function does not convert a data frame to a vector, it only formats the values in a data frame.\n","\n","To convert the data frame to a vector, you can use the unlist() function. The unlist() function converts a data frame to a vector by extracting the values from the data frame and combining them into a single vector.\n","\n","**Interpreting Lift:**\n","\n","Lift > 1: Indicates that the brand is more likely to be preferred in the segment compared to the overall population. \n","\n","Lift < 1: Indicates that the brand is less likely to be preferred in the segment compared to the overall population. \n","\n","Lift = 1: Indicates that the brand preference is proportional in both the segment and the overall population.\n","\n","**Conclusion:** It's evident that among Mainstream - Young Singles/Couples, Tyrrells stands out as the preferred brand which more than 21%, while Burger is the least favored option which is less than 50%\"\n","\n","Additionally, Twisties, Doritos, Tostitos, Kettle, Pringles, and Cobs present promising opportunities for further sales growth within the Mainstream - Young Singles/Couples segment, complementing the popularity of Tyrrells.\n","\n","##### Step 7: Let's also find out if our target segment tends to buy larger packs of chips."]},{"cell_type":"code","execution_count":25,"id":"0cb6f5ce","metadata":{"execution":{"iopub.execute_input":"2023-10-17T09:08:30.898055Z","iopub.status.busy":"2023-10-17T09:08:30.896387Z","iopub.status.idle":"2023-10-17T09:08:31.034882Z","shell.execute_reply":"2023-10-17T09:08:31.032994Z"},"papermill":{"duration":0.16534,"end_time":"2023-10-17T09:08:31.037692","exception":false,"start_time":"2023-10-17T09:08:30.872352","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 20 × 4</caption>\n","<thead>\n","\t<tr><th scope=col>PACK_SIZE</th><th scope=col>occurences_pack</th><th scope=col>predicted_trans_pack</th><th scope=col>lift_pack</th></tr>\n","\t<tr><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>270</td><td> 620</td><td> 497.8278</td><td>1.2454105</td></tr>\n","\t<tr><td>380</td><td> 626</td><td> 508.2042</td><td>1.2317883</td></tr>\n","\t<tr><td>330</td><td>1195</td><td> 993.2794</td><td>1.2030855</td></tr>\n","\t<tr><td>134</td><td>2315</td><td>1988.3014</td><td>1.1643104</td></tr>\n","\t<tr><td>210</td><td> 576</td><td> 496.7981</td><td>1.1594247</td></tr>\n","\t<tr><td>110</td><td>2051</td><td>1773.2493</td><td>1.1566338</td></tr>\n","\t<tr><td>135</td><td> 290</td><td> 257.9833</td><td>1.1241036</td></tr>\n","\t<tr><td>250</td><td> 280</td><td> 251.0130</td><td>1.1154803</td></tr>\n","\t<tr><td>170</td><td>1575</td><td>1582.8311</td><td>0.9950525</td></tr>\n","\t<tr><td>150</td><td>3080</td><td>3184.4348</td><td>0.9672046</t